import './App.css';
import Home from './Home';
import { Link, Route, Routes, BrowserRouter } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
      <nav>
        <Link to="/">Home</Link> |
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
      <Link to="/">
        <button>Home</button>
      </Link>
    </BrowserRouter>
  );
}

export default App;
